"""
1060. Missing Element in Sorted Array
Medium

Given an integer array nums which is sorted in ascending order and all of its elements are unique
and given also an integer k, return the kth missing number starting from the leftmost number of
the array.

https://leetcode.com/problems/missing-element-in-sorted-array/

"""
from collections import deque
from itertools import islice
from typing import *


class Solution:
    def missingElement_takesTooLong(self, nums: List[int], k: int) -> int:
        first = nums[0]
        nums = set(nums)
        def nextm():
            for x in range(first, int(1e12)):
                if x not in nums:
                    yield x
        return next(islice(iter(nextm()), k-1, None))

    def missingElement(self, nums: List[int], k: int) -> int:
        guess = nums[0] + k
        for n in nums[1:]:
            if n <= guess:
                guess += 1
            else:
                break
        return guess


